<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>E-signature</title>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.4/css/all.min.css">
    <style>
            *{
        margin: 0;
        padding: 0;
    }
    .top_container{
        height: 90vh;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
    }
    .container{
        width: 100%;
        margin-top: 5rem;
        position: relative;
        overflow: hidden;
    }

    .relative-left{
        position: absolute;
        top: 0;
        right: 0;
        height: 100%;
    }
    .relative-left img{
        position: absolute;
        top: 0;
        right: 0;
        height: 90%;
    }
    a{
        color: black;
        text-decoration: none;
    }

    .logo{
        width: 70%;
        height: 60%;
    }
    .logo img{
        width: 100%;
        height: 100%;
    }
    .logoContent{
    display: flex;
    justify-content: center;
        align-items: center;
        flex-direction: column;
        width:23%;
        margin-bottom: 30px;
    }
    .logoContent h1{
        color: blue;
        font-size: 1.2em;
        margin: 0;
        text-transform: uppercase;
    }
    .logoContent h1 span{
        color: gray;
    }

    .name{
        margin-top: 10px;
        display: flex;
        
    }
    .name_title{
        border-bottom: 2px solid #2366ba;
        width: 100%;    
        padding: 4px;
    }

    .name h1{
        color: #2366ba;    
    }
    .color_container{
        background-color: #2366ba;
        width: 4%;
        color: #2366ba;
        margin-right: 15px;
    }

    .contact{
        padding: 3%;
        text-align: left;
        display: flex;

    }

    .contact_info{
        display: flex;
        align-items: center;
        margin: 12px 0;
    }

    .icon{
        border: #2366ba 2px solid ;
        border-radius: 50%;
        padding: 6px;
        margin-right: 8px;
        width: 20px;
        height: 20px;
        text-align: center;
        font-size: 20px;
        display: flex;
        justify-content: center;
        align-items: center;
    }
    .s_icon{
        border: #2366ba 2px solid ;
        border-radius: 50%;
        padding: 6px;
        margin-right: 8px;
        background-color: #2366ba;
        width: 20px;
        color: white;
        height: 20px;
        text-align: center;
        font-size: 20px;
        display: flex;
        justify-content: center;
        align-items: center;
        
    }
    .s_icon a{
        color: white;
        text-decoration: none;
        
    }

    .social_icons{
        display: flex;
        gap: 2;
    }
    .phone-number{
        font-size: 20px;
    }
    .contact-border-container{
        padding: 15px 0 ;
        margin: 0 2%;
    }

    .contact-border{
        color: #2366ba;
        background-color: #2366ba;
        height: 100%;
    }

    .bg-footer{
        width: 100%;
        height: 30px;   
        color: #2366ba;
        background-color: #2366ba;
    }

    @media (max-width: 1200px) {
        .relative-left{
            position: absolute;
            top: 0;
            right: 0;
            width: 100%;
            height: 100%;
        }
        .relative-left img{
            position: absolute;
            top: 0;
            right: 0;
            width: 70%;
            height: 80%;
        }
        .logoContent{
            margin-left: 4px;
            margin-bottom: 0px;
            width: 28%;
        }
        .logoContent h1{
            font-size: 12px;
        
        }
    
    }

    @media (max-width: 912px) {
        .relative-left{
            position: absolute;
            top: 0;
            right: 0;
            width: 100%;
            height: 100%;
        }
        .relative-left img{
            position: absolute;
            top: 0;
            right: 0;
            width: 70%;
            height: 80%;
        }
        .logoContent{
            margin-left: 4px;
            margin-bottom: 0px;
            width: 28%;
        }
        .logoContent h1{
            font-size: 12px;
        
        }
        .name h1{
            font-size: 17px; 
        }
        .name h3{
            font-size: 11px; 
        }
        .color_container{
            margin-right: 5px;
        }
        .icon {
            padding: 6px;
            margin-right: 4px;
            width: 8px;
            height: 8px;
            text-align: center;
            font-size: 12px;
        }
        .s_icon {
            padding: 6px;
            margin-right: 4px;
            width: 8px;
            height: 8px;
            text-align: center;
            font-size: 12px;
        }
        .phone-number {
            font-size: 15px;
        }
        .contact-border {
            font-size: 17px;
            
        }
        .contact-border-container {
            padding: 4px 0;
            margin: 1% 2%;
        }
        .bg-footer{
            width: 100%;
            height: 10%;   
            
        }
    
    }


    @media (max-width: 500px) {
        .relative-left{
            position: absolute;
            top: 0;
            right: 0;
            width: 100%;
            height: 100%;
        }
        .relative-left img{
            position: absolute;
            top: 0;
            right: 0;
            width: 70%;
            height: 60%;
        }
        .logoContent{
            margin-left: 4px;
            margin-bottom: 0px;
            width: 33%;
        }
        .logoContent h1{
            font-size: 6px;
        
        }
        .name h1{
            font-size: 10px; 
        }
        .name h3{
            font-size: 8px; 
        }
        .color_container{
            margin-right: 5px;
        }
        .icon {
            padding: 6px;
            margin-right: 4px;
            width: 2px;
            height: 2px;
            text-align: center;
            font-size: 8px;
            
        }
        .s_icon {
            padding: 6px;
            margin-right: 4px;
            width: 2px;
            height: 2px;
            text-align: center;
            font-size: 8px;
            
        }
        .phone-number {
            font-size: 8px;
        }
        .contact-border {
            font-size: 9px;
            
        }
        .contact-border-container {
            padding: 4px 0;
            margin: 2% 2%;
        }
        .bg-footer{
            width: 100%;
            height: 10%;   
            
        }
    
    }
    </style>
</head>
